  BrowserRouter as Router,
  Links,
  Routes,
  Route,

} from "react-router-dom";



function App() {
  return (
    <>
    <Router>

    <Navbar title = "My" />
    <div className="con my-5">
    <Routes>
          <Route path="/about">
            <About />
          </Route>

          <Route path="/">
            <Textform title = "Enter the text" />
          </Route>
    </Routes>

    </div>

    </Router>
    </>
  );
}

export default App;
